NUMBER = ''


def divide(arr):
    """Func return divided string"""
    i = 1
    for num in arr:
        i *= int(num)
    return i


new_list = [i for i in NUMBER]


def main_func(some_list):
    index_start = 0
    index_end = 13
    elem = ''  # empty variable for number in string format
    max_elem = 0  # variable for max divided number
    for j in range(987):  # general circle in range 1000 - 13
        for i in range(index_start, index_end):  # this circle iterables elements and add in elem
            elem += some_list[i]
        if max_elem < divide(elem):  # divide numbers in elem and compare with max element
            max_elem = divide(elem)
        elem = ''  # return elem for new iterable
        index_start += 1  # change indexes
        index_end += 1
    return max_elem


print(main_func(new_list))
